tables.table_schema:
CREATE TABLE PrinterCalibrationData (
    calibration_id INT PRIMARY KEY,
    printer_name TEXT,
    calibration_date DATE,
    calibration_settings JSON
);

CREATE TABLE PrinterLogs (
    log_id INT PRIMARY KEY,
    printer_name TEXT,
    log_timestamp TIMESTAMP,
    log_message TEXT
);

CREATE TABLE PrinterModels (
    model_id INT PRIMARY KEY,
    model_name TEXT,
    manufacturer TEXT,
    print_volume_cm3 DECIMAL
);

CREATE TABLE Project (
    id INT PRIMARY KEY,
    name VARCHAR(50),
    description TEXT,
    creation_date DATE
);
